void SysTick_Init(){
	NVIC_ST_CTRL_R &= 0x00;
	NVIC_ST_RELOAD_R = 3000000;  
	NVIC_ST_CURRENT_R = 0x00;
	NVIC_SYS_PRI3_R= (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000;
	NVIC_ST_CTRL_R = 0x00000007;
}

uint32_t Convert(uint32_t input){
	uint32_t output;
	output = input; 
  return (output);
}  

